                    evt = evt.originalEvent;
                    touch && (evt = evt.changedTouches[0]);
        
                    set.end.call(ele, evt);

                    $D.unbind("mouseup touchend", mouseUp);
                     $D.unbind("mousemove touchmove", mouseMove);
